import React, { useState, useEffect } from 'react';
import { Table, Checkbox, TableBody, TableCell, TableContainer, TableHead, TableRow, Button, Dialog, DialogTitle, DialogContent, DialogActions } from '@mui/material';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import { Stack } from '@mui/system';
import InputLabel from '@mui/material/InputLabel';
import FormControl from '@mui/material/FormControl';
import axios from 'axios';
import { Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';

const SpecialProjectEvaluation = () => {
  const [projectInfo, setProjectInfo] = useState({
    projectName: '',
    studentName: '',
    advisorName: '',
  });
  
  const [evaluation, setEvaluation] = useState({
    score: '',
    comments: '',
  });
  const [openPopup, setOpenPopup] = useState(false);
  const [projects, setProjects] = useState([]); // State สำหรับเก็บข้อมูลโครงงานที่ดึงมาจาก API
  const [selectedProject, setSelectedProject] = useState(''); // State สำหรับเก็บโครงงานที่ถูกเลือก

  const handleClosePopup = () => {
    setOpenPopup(false);
  };

  const handleLinkClick = (index) => {
    setOpenPopup(true);
    setSelectedRow(index);
  };

  const handleSavePopup = (e) => {
    handleSubmit(e);
    setOpenPopup(false);
    handleClosePopup();
    const updatedData = [...tableData];
    updatedData[selectedRow].isRed = false;
    updatedData[selectedRow].isDisabled = true;
    setTableData(updatedData);
    saveScore();
  };

  useEffect(() => {
    // ใช้ useEffect เพื่อเรียกข้อมูลโครงงานจาก API เมื่อคอมโพเนนต์ถูกโหลด
    axios.get('http://localhost:9999/Project')
      .then((response) => {
        setProjects(response.data); // ตั้งค่าโครงงานใน state
      })
      .catch((error) => {
        console.error('Error fetching projects:', error);
      });
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setEvaluation({ ...evaluation, [name]: value });
  };

  const handleProjectChange = (e) => {
    const selectedProject = e.target.value;
    setSelectedProject(selectedProject);

    // ค้นหาโครงงานที่ถูกเลือกจาก state projects
    const project = projects.find(proj => proj.P_id === selectedProject);
    if (project) {
      setProjectInfo({
        projectName: project.P_name,
        studentName: project.P_S1,
        advisorName: project.P_T,
      });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Submitting Evaluation:', evaluation);
    alert('การประเมินถูกส่งเรียบร้อยแล้ว');
  };

  const handleDonNotGoAny = () => {
    // Logic สำหรับ "ไม่เข้าร่วมประเมินทั้งหมด"
    alert('การดำเนินการไม่เข้าร่วมประเมินทั้งหมด');
  };

  return (
    <MainCard>
      <Grid container spacing={gridSpacing}>
        <Grid item xs={12}>
          <Grid container alignItems="center" justifyContent="space-between">
            <Grid item>
              <div>
                <h1>ประเมินการสอบหัวข้อโครงงานพิเศษ</h1>
                <Button onClick={handleDonNotGoAny} variant="contained" color="error">
                  ไม่เข้าร่วมประเมินทั้งหมด
                </Button>

                <TableContainer component={Paper} style={{ marginTop: '20px' }}>
                  <Table>
                    <TableHead>
                      <TableRow>
                        <TableCell>ลำดับที่</TableCell>
                        <TableCell>ชื่อโครงงาน</TableCell>
                        <TableCell>การประเมิน</TableCell>
                      </TableRow>
                    </TableHead>
                    <TableBody>
                    <Dialog open={openPopup} onClose={handleClosePopup} maxWidth='xl' fullWidth>
                      {projects.map((project, index) => (
                        <TableRow key={project.P_id}>
                          <TableCell>{index + 1}</TableCell>
                          <TableCell>{project.P_name}</TableCell>
                          <TableCell>
                          
                          </TableCell>
                        </TableRow>
                      ))}
                      </Dialog>
                    </TableBody>
                  </Table>
                </TableContainer>
              </div>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </MainCard>
  );
};

export default SpecialProjectEvaluation;
